import React from 'react';
import '../styles/TrendAnalysis.css';

const TrendAnalysis = ({ trend }) => (
  <div className="trend-analysis">
    <h2>Hottest Trend Analysis</h2>
    {trend.map((video, index) => (
      <div key={index}>
        <p><strong>Top {index + 1}:</strong> {video.title}</p>
        <p><strong>Likes:</strong> {video.likeCount}</p>
        <p><strong>Comments:</strong> {video.commentCount}</p>
        <p><strong>Shares:</strong> {video.shareCount}</p>
        <p><strong>Views:</strong> {video.viewCount}</p>
      </div>
    ))}
    <p>Retrieved using Tiktok API - Video Object</p>
  </div>
);

export default TrendAnalysis;
